import React, { useState } from "react";
import PublicMapView from "./PublicMapView";
import OfficeDashboard from "./OfficeDashboard";

const App = () => {
  const [loggedInOffice, setLoggedInOffice] = useState(null);

  return (
    <div>
      {loggedInOffice ? (
        <OfficeDashboard loggedInOffice={loggedInOffice} setLoggedInOffice={setLoggedInOffice} />
      ) : (
        <PublicMapView setLoggedInOffice={setLoggedInOffice} />
      )}
    </div>
  );
};

export default App;
